        ═════════════════════════════════════

        [bold]РАЗРЕШЕНИЕ НА ПЕРЕМЕЩЕНИЕ[/bold]

        ═════════════════════════════════════


        Судно медицинского назначения "MS-24 Святой Парацельс" обладает всеми правами на перемещение внутри юрисдикции корпорации NanoTrasen согласно подписанному контракту о коммерческой деятельности и прохождению всех необходимых процедур проверки. 


        Данное разрешение будет аннулировано автоматически после нарушения следующих условий:

        Нарушение статьи средней и выше тяжести Корпоративного Закона.

        Неподчинение требованию Центрального Командования на стыковку к ближайшей научно-исследовательской станции во время кода угрозы "Сьерра".

        Неподчинение требованиям Высшего Командного Состава научно-исследовательской станции.

        Игнорирование требования в ознакомлении с данным разрешением действующего Капитана станции.

        Пристыковка ко станции на которой действует код угрозы "Фиолетовый" более чем на 10 секунд. Отстыковка обязательна и последующая пристыковка будет считаться причиной аннулирования разрешения.

        Перемещение по научно-исследовательским станциям после того, как срок разрешения истечёт (05.10.2719).


        После аннулирования разрешения из-за нарушения одного из пунктов, весь экипаж будет считаться незарегистрированными лицами и будут подлежать аресту.

